import { useEffect, useState } from 'react';
import type { AuthPayload } from '../services/backend';
import { getUsers, login, logout, register } from '../services/backend';
import './index.less';

type Mode = 'login' | 'register';

export default function IndexPage() {
  const [mode, setMode] = useState<Mode>('login');
  const [form, setForm] = useState<AuthPayload>({ username: '', password: '' });
  const [token, setToken] = useState<string>();
  const [users, setUsers] = useState<string[]>([]);
  const [currentUser, setCurrentUser] = useState('');
  const [status, setStatus] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    if (!token) {
      return;
    }
    getUsers(token)
      .then((data) => {
        setUsers(data.users.map((u) => u.username));
        setCurrentUser(data.me);
        setError('');
        setStatus('');
      })
      .catch((err) => setError(err.message));
  }, [token]);

  const updateField = (key: keyof AuthPayload, value: string) => {
    setForm((prev) => ({ ...prev, [key]: value }));
  };

  const handleSubmit = async (event: React.FormEvent) => {
    event.preventDefault();
    setStatus('');
    setError('');

    try {
      if (mode === 'register') {
        const result = await register(form);
        setStatus(result.message);
        setMode('login');
      } else {
        const result = await login(form);
        if (result.token) {
          setToken(result.token);
          setStatus('');
        }
      }
    } catch (err) {
      if (err instanceof Error) {
        setError(err.message);
      } else {
        setError('');
      }
    }
  };

  const authenticated = Boolean(token);

  const handleLogout = async () => {
    if (!token) {
      return;
    }
    setError('');
    setStatus('');
    try {
      const response = await logout(token);
      setStatus(response.message || '');
    } catch (err) {
      if (err instanceof Error) {
        setError(err.message);
        return;
      }
      setError('');
      return;
    }
    setToken(undefined);
    setUsers([]);
    setCurrentUser('');
  };

  const rootClass = authenticated ? 'app admin' : 'app auth';

  return (
    <div className={rootClass}>
      {!authenticated ? (
        <div className="auth-card">
          <h1></h1>
          <div className="toggle">
            <button
              type="button"
              className={mode === 'login' ? 'active' : ''}
              onClick={() => setMode('login')}
            >

            </button>
            <button
              type="button"
              className={mode === 'register' ? 'active' : ''}
              onClick={() => setMode('register')}
            >

            </button>
          </div>
          <form onSubmit={handleSubmit} className="form">
            <label>

              <input
                value={form.username}
                onChange={(e) => updateField('username', e.target.value)}
                placeholder=""
              />
            </label>
            <label>

              <input
                type="password"
                value={form.password}
                onChange={(e) => updateField('password', e.target.value)}
                placeholder=""
              />
            </label>
            <button className="primary" type="submit">
              {mode === 'login' ? '' : ''}
            </button>
          </form>
          {status && <div className="status">{status}</div>}
          {error && <div className="error">{error}</div>}
        </div>
      ) : (
        <div className="layout">
          <aside className="sidebar">
            <div className="logo"></div>
            <nav className="nav">
              <button className="nav-item active"></button>
            </nav>
          </aside>
          <section className="content">
            <header className="topbar">
              <div className="title"></div>
              <button className="profile" type="button" onClick={handleLogout}>
                {currentUser}  
              </button>
            </header>
            <main className="main">
              <div className="card">
                <div className="me">{currentUser}</div>
                <h2></h2>
                <table className="user-table">
                  <thead>
                    <tr>
                      <th>#</th>
                      <th></th>
                    </tr>
                  </thead>
                  <tbody>
                    {users.map((user, index) => (
                      <tr key={user}>
                        <td>{index + 1}</td>
                        <td>{user}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
              <div className="feedback">
                {status && <div className="status">{status}</div>}
                {error && <div className="error">{error}</div>}
              </div>
            </main>
          </section>
        </div>
      )}
    </div>
  );
}
